style.css:
/* Global Stylish CSS for a playful rainbow-themed background */
@-webkit-keyframes rainbow {
  0% { background-color: red; }
  16% { background-color: orange; }
  33% { background-color: yellow; }
  50% { background-color: green; }
  66% { background-color: blue; }
  83% { background-color: indigo; }
  100% { background-color: violet; }
}

@keyframes rainbow {
  0% { background-color: red; }
  16% { background-color: orange; }
  33% { background-color: yellow; }
  50% { background-color: green; }
  66% { background-color: blue; }
  83% { background-color: indigo; }
  100% { background-color: violet; }
}

body {
  background-color: #fff;
  background-image: url('https://link-to-your-rainbow-image.png'); /* Replace with a rainbow image URL */
  background-repeat: no-repeat;
  background-attachment: fixed;
  background-size: cover;
  animation: rainbow 10s infinite;
}

img {
  border: 5px solid #FF69B4;
  box-shadow: 0px 0px 15px 5px rgba(255,105,180,0.7);
}

a {
  color: #FF69B4 !important; /* Bright pink text for links */
  font-weight: bold;
}

button {
  background-color: #FF69B4 !important; /* Pink buttons */
  color: #fff !important;
  border: none;
  padding: 10px 20px;
  font-weight: bold;
}

h1, h2, h3, h4, h5, h6 {
  color: #FF69B4 !important;
  text-shadow: 2px 2px #FF4500;
}
